  // === Fonction principale pour activer le GPS ===
let userMarker;

function locateUser(showMessage = true) {
    if (!navigator.geolocation) {
        alert("â ï¸ Le GPS n'est pas supportÃ© par ce navigateur.");
        return;
    }

    navigator.geolocation.getCurrentPosition(
        function(position) {
            const lat = position.coords.latitude;
            const lng = position.coords.longitude;

            // Supprimer l'ancien marqueur si existe
            if (userMarker) map_4f43da21b80cc12ddaed1f5dbdb36275.removeLayer(userMarker);

            // Ajouter le marqueur du nouveau point
            userMarker = L.marker([lat, lng])
                .addTo(map_4f43da21b80cc12ddaed1f5dbdb36275)
                .bindPopup("ð Vous Ãªtes ici").openPopup();

            // Centrer la carte sur la position
            map_4f43da21b80cc12ddaed1f5dbdb36275.setView([lat, lng], 15);

            if (showMessage) {
                console.log("â Position mise Ã  jour !");
            }
        },
        function(error) {
            alert("â ï¸ Erreur de gÃ©olocalisation : " + error.message);
        },
        { enableHighAccuracy: true, timeout: 10000 }
    );
}

// === DÃ©marrage automatique du GPS au chargement ===
locateUser(false);

// === Bouton "Actualiser ma position" en bas ===
const gpsButton = L.DomUtil.create('button', 'gps-refresh-button');
gpsButton.innerHTML = 'ð Actualiser ma position';
Object.assign(gpsButton.style, {
    position: 'fixed',
    bottom: '20px',
    left: '50%',
    transform: 'translateX(-50%)',
    padding: '12px 20px',
    background: '#0078FF',
    color: 'white',
    fontSize: '16px',
    fontWeight: 'bold',
    border: 'none',
    borderRadius: '10px',
    boxShadow: '0 2px 6px rgba(0,0,0,0.3)',
    cursor: 'pointer',
    zIndex: '9999'
});
gpsButton.onclick = () => locateUser();
document.body.appendChild(gpsButton);

</script>
